select 
	substring(replace( 
		case 
		when detail is null then test_name
		when test_name = 'Progesterone' then
			case when detail = 'Ovulation confirmed' then 'ProgesteroneOvConf'
			when detail = 'Ovulation possible' then 'ProgesteroneOvPoss'
			when detail = 'Ovulation unlikely' then 'ProgesteroneOvUnlk'
			when detail = 'Post menopausal' then 'ProgesteronePostMP'
			else 'Progesterone' end
		when test_name = 'Quantiferon Mitogen - Nil' then
			case when detail = 'Indeterminate' then 'QuantiferonMitogenNI'
			when detail = 'Negative' then 'QuantiferonMitogenNN'
			else 'QuantiferonMitogenN' end
		when test_name = 'Quantiferon TB1/TB2 Antigen - Nil' then
			case when detail = 'Positive if Nil under 8.0' then 'QuantiferonTB1TB2Pos'
			when detail = 'Use Mitogen result' then 'QuantiferonTB1TB2Mit'
			else 'QuantiferonTB1TB2' end		
		when detail = 'Prenatal' or test_name in (
				-- detail on these tests is oriented towards the procedure conditions, not result characterization
				'Glucose', 'Glucose Tolerance', 'SHBG'
					)
			then case when test_name = 'Glucose Tolerance' then
						case when detail = 'Non-Pregnant 2 hour' then 'GlucoseToleranceNP2H'
							when detail = 'Non-Pregnant Fasting' then 'GlucoseToleranceNPF'
							when detail = 'Pregnant 2 hour' then 'GlucoseToleranceP2H'
							when detail = 'Pregnant Fasting' then 'GlucoseTolerancePF'
							else 'GlucoseTolerance' end
			else
				test_name + detail
			end
		else
			test_name + case when detail like 'Vitamin D intoxication has been reported at this level%' 
				then 'Intox' else detail end
		end
	,' ',''),1,20)
	,
	5,
	10 * row_number() over (PARTITION BY test_name order by sex, detail, 	
	isnull(case when left(age_from_unit,1) = 'D' then 'A' 
		when left(age_from_unit,1) = 'W' then 'B' 
		else left(age_from_unit,1) end,'Z'), 
	isnull(case when left(age_to_unit,1) = 'D' then 'A' 
		when left(age_to_unit,1) = 'W' then 'B' 
		else left(age_to_unit,1) end,'Z'), 
	age_from,
	age_to) as result_range_sequence,
	row_number() over (PARTITION BY test_name order by sex, detail, 	
	isnull(case when left(age_from_unit,1) = 'D' then 'A' 
		when left(age_from_unit,1) = 'W' then 'B' 
		else left(age_from_unit,1) end,'Z'), 
	isnull(case when left(age_to_unit,1) = 'D' then 'A' 
		when left(age_to_unit,1) = 'W' then 'B' 
		else left(age_to_unit,1) end,'Z'), 
	age_from,
	age_to) as search_sequence,
	left(sex,1),
	r.age_range_id,
	u.unit_id,
	convert(real,
		replace(substring (reference_range, 1, charindex(' ',reference_range) - 1),',','')
	) 
	as low_normal,
	case when reference_range like '%+%' then NULL
		else
	convert(real,
			replace(trim(substring (reference_range
				, charindex('-',reference_range) + 1
				, 100))
			,',','')
	) 
	end as high_normal,
	reference_range,
	detail
from c_Lab_Reference_Range r
left join c_Age_Range a on a.age_range_id = r.age_range_id
left join c_Unit u on u.description = r.units
